ReactDOM.render(
  <>
    <Card
      imgsrc="https://upload.wikimedia.org/wikipedia/commons/3/38/Stranger_Things_logo.png"
      title="A Netflix Orignal Series"
      sn="Stranger Things"
      link="https://www.netflix.com/in/"
    />
    <Card imgsrc="https://upload.wikimedia.org/wikipedia/en/d/da/DarkNetflixPosterEnglish.jpg"
    title="A Netflix Orignal Series" />

  </>,
  document.getElementById("root")
);
